Location.prototype.find = function(id) {  
    if(typeof(this.items[id]) == "undefined")  
        return false;  
    return this.items[id];  
}  
  
Location.prototype.fillOption = function(el_id , loc_id , selectedText) {  
    var el = $(el_id);  
    el.empty();
      
    var json = this.find(loc_id);  
      
    if (json) {  
        var index = 0;  
        var selected_index = 0;  
        var selected_text = '';
        
        $.each(json , function(k , v) {  
            var option = '<a href="javascript:void(0)" value="'+k+'">'+v+'</a>';  
            if ($.trim(v) == $.trim(selectedText) || $.trim(k) == $.trim(selectedText)) {  
                option = '<a href="javascript:void(0)" class="select" value="'+k+'">'+v+'</a>';  
                selected_index  = index; 
                selected_text = v; 
            }  
            el.append(option);  
            index++;  
        })  
        el.attr('selectedIndex' , selected_index);
        el.attr('selectedText' , selected_text);  
    }  
}  